//import { useState, useEffect } from "react";
import SneakersCard from "../component/sneakersCard";

function Men() {
	return (
		<div className='cards_container'>
			<SneakersCard
				price='111'
				rating={3}
				img='https://images.unsplash.com/photo-1603808033587-935942847de4?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1412&q=80'
				promo='discount'
				color='blue'
			/>
		</div>
	);
}

export default Men;
